questionvariables.text:
/* a: Whole numbers 1-20 (all integers possible) */
a: rand(1000) + 1;
ta: float(1/a);

/* First choose integer part (0-9), then decimal part (0-999) */
b_int: rand(5999)+2;  
b_dec: rand(10000);  
b1: float(b_int / b_dec);
b:decimalplaces(b1,4);
b_ta: 1.0/b;

if b = 0 then b: 0.00001;  /* Ensure not zero */

/* Calculate reciprocals */
ta1: decimalplaces(ta,4);
ta2: decimalplaces(b_ta,4);
